import Vue from "vue";
import VueRouter from "vue-router";

// Import your domain-specific components
import MachineLearning from "@/views/MachineLearning.vue";
import SoftwareDevelopment from "@/views/SoftwareDevelopment.vue";
import Robotics from "@/views/Robotics.vue";
import Realtor from "@/views/Realtor.vue";

Vue.use(VueRouter);

const routes = [
  {
    path: "/domains/machine-learning",
    name: "MachineLearning",
    component: MachineLearning,
  },
  {
    path: "/domains/software-development",
    name: "SoftwareDevelopment",
    component: SoftwareDevelopment,
  },
  {
    path: "/domains/robotics",
    name: "Robotics",
    component: Robotics,
  },
  {
    path: "/domains/realtor",
    name: "Realtor",
    component: Realtor,
  },
];

const router = new VueRouter({
  mode: "history", // Use "history" mode for cleaner URLs
  routes,
});

export default router;
